        public void inicializar()
        {
            Clases.metodos csmet = Clases.metodos.Instance;

            if(csmet.CONFIG["Alineacion_integ2"].Equals("1") || csmet.CONFIG["Alineacion_integ14"].Equals("1"))
            {
                for(int i = 1; i <= 15; i++)
                {
                    csmet.CONFIG.Remove("Alineacion_integ" + i);
                    csmet.CONFIG.Add("Alineacion_integ" + i, "0");
                }

                csmet.CONFIG.Remove("Botones_usados");
                csmet.CONFIG.Add("Botones_usados", "0000000000000000000");
                csmet.CONFIG.Remove("Ult_fdd");
                csmet.CONFIG.Add("Ult_fdd", "");
                csmet.CONFIG.Remove("num_fdd");
                csmet.CONFIG.Add("num_fdd", "0");
                csmet.CONFIG.Remove("Ult_ldd");
                csmet.CONFIG.Add("Ult_ldd", "");
                csmet.CONFIG.Remove("num_ldd");
                csmet.CONFIG.Add("num_ldd", "0");
                csmet.guardarConfig();
            }

            label5.Text = csmet.darGeeksEncontrados() + "/" + csmet.darTotalGeeks();

            if (csmet.darGeeksEncontrados() == csmet.darTotalGeeks())
            {
                imgCompletos.Image = global::Herramientas.Properties.Resources.extrageek_peq;
                label2.Text = "¡Felicitaciones! ¡Has encontrado a los " + csmet.darTotalGeeks() + " Geeks!";
            }
            else
            {
                imgCompletos.Image = global::Herramientas.Properties.Resources.extrageek_bnpeq;
                label2.Text = "En la Barra Matrix se encuentran " + csmet.darTotalGeeks() + " Geeks, ¿puedes encontrarlos a todos?";
            }


            if (csmet.CONFIG["Alineacion_integ3"].Equals("1"))
                imgRMarino.Image = global::Herramientas.Properties.Resources.integ3;
            else
                imgRMarino.Image = global::Herramientas.Properties.Resources.extrageek_bn;

